import "./style.css";

export default class Styling extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            loggedIn: false
        }
    }

    render() {
        return (
            <div>
                <div style={{ backgroundColor: "#ff0000", width: 200, textAlign: "center" }}
                >
                    Nextstacks
                </div>
                <div className="mydiv2">
                    Appstone
                </div>
            </div>
        )
    }
}
